// import React from "react";

const Name = "Himanshu"
const Age = 19;

function MYself() {
    let City = "Noida"
    return City;
}

function MyNot() {
    let City2 = "Delhi"
    return City2;
}



export default Name;
export { MyNot, MYself, Age }
